import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expanded, setExpand] = useState({
    isExpanded: false,
    expandedIndex: -1,
  });

  const handleListExpand = (index) => {
    console.log(data[index]);
    return setExpand({
      isExpanded: true,
      expandedIndex: index,
    });
  };

  console.log(data);

  if (data.child) {
    console.log("Hello");
    return (
      <div className="list__container">
        <ul className="list__items">
          <Fragment>
            <li className="list__item">{data.title}</li>
            {data.map((d) =>
              d.child && d.child.length > 0 ? <List data={d.child} /> : null
            )}
          </Fragment>
        </ul>
      </div>
    );
  }

  return (
    <div className="list__container">
      <ul className="list__items">
        <li className="list__item">Demand</li>
        <li className="list__item">
          Stored Procedures
          <ul className="list__items">
            <li className="list__item">New</li>
            <li className="list__item">Select</li>
          </ul>
        </li>
        <li className="list__item">
          Masters
          <ul className="list__items">
            <li className="list__item">Store</li>
            <li className="list__item">
              Inventory
              <ul className="list__items">
                <li className="list__item">New</li>
                <li className="list__item">Select</li>
              </ul>
            </li>
            <li className="list__item">
              Users
              <ul className="list__items">
                <li className="list__item">
                  Employee
                  <ul className="list__items">
                    <li className="list__item">
                      Designation
                      <ul className="list__items">
                        <li className="list__item">New</li>
                        <li className="list__item">Select</li>
                      </ul>
                    </li>
                  </ul>
                </li>
              </ul>
            </li>
          </ul>
        </li>
        <li className="list__item">Profile</li>
        <li className="list__item">Settings</li>
      </ul>
    </div>
  );
}

export default List;
